import React, {useState} from 'react';
import Contact from '../pure/contact';
import { User } from '../../models/userClass';


const ContactList = () => {
    console.log('entrando en ContactList');
    const userList = [
        new User('Pedro','Rodriguez','Disconnected'),
        new User('Carlos','Perez','Connected'),
        new User('Ana','López','Disconnected'),
    ];
    
    // const [change, setChange] = useState(false);

    // const changeStatus = () =>{
    //     setChange(!change);
    // }

    return (

            <table >
                <thead>
                    <tr>
                        <th>Nombre</th>
                        <th>Apellido</th>
                        <th>Status</th>
                        <th className='btn-change-status'></th>
                    </tr>
                </thead>
                <tbody>
                    {/* <tr>
                        <td>carmen</td>
                        <td>lopez</td>
                        <td>conectada</td>
                        <td><i class="bi bi-toggle2-off"></i></td>
                    </tr> */}
  
                        <Contact usuario={userList[0]}/>
                        <Contact usuario={userList[1]}/>
                        <Contact usuario={userList[2]}/>

                        
                </tbody>
            </table>
    );
};


export default ContactList;
